import axios from "axios";
import { ref } from "vue";

export default function backend(url) {
  const apiUrl = 'http://localhost:8000/api/';
  let apiData = '';

  const apiCall = async () => {
    return fetch(apiUrl+'calendar/week')
      .then(res => res.json()) //returning a promise To extract the JSON body content from the response
      .then(resJson => {
        apiData = resJson
      })
  }

  apiCall();

  console.log(apiData);

  return {
    apiData
  }
}
